class Solution:
    def kthCharacter(self, s: str, k: int) -> str:
        delta = 1
        idx = -1
        for i, v in enumerate(s):
            if i == 0 or s[i-1] == ' ' or s[i] == ' ':
                delta = 1
            idx += delta
            if idx >= k:
                return v
            delta += 1
        return ''  # The control will never reach here as per the problem constraints

    def kthCharacter_1(self, s: str, k: int) -> str:
        words = s.split()
        k += 1
        for word in words:
            if k <= 0:
                break
            for i, v in enumerate(word):
                k -= (i + 1)
                if k <= 0:
                    return v
            k -= 1
        return ' '

